import React from 'react';
import { siteData } from '../utils/mockData';
import './client.css';

const Client=()=>{
    return(
    <div>
        {siteData.map(({data})=>
            <div>
            <img src={data.siteImage} alt="Site"/>
            <p>{data.para}</p>
            </div>
        )}
    </div>
    )
} 
export default Client;
